    count = 1
    for i in range(len(paren_string)):
        if paren_string[i] == '(':
            count += 1
        if paren_string[i] == ')':
            count -= 1
        if count == 0:
            result.append(paren_string[0:i + 1])
            paren_string = paren_string[i + 1:]
            break
    return result + separate_paren_groups(paren_string)

